import React from 'react';
import { NavLink } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import OpenInBrowserIcon from '@material-ui/icons/OpenInBrowser';

function refreshPage() {
    return <Redirect to='/target' />
  }

const SignedOutLinks = () => {
    return(
        <div>
            <Button color="inherit"><NavLink exact to="/signup" className="navlink" onClick={refreshPage}><PersonAddIcon className="navbaricons" /></NavLink></Button>
            <Button color="inherit"><NavLink exact to="/signin" className="navlink" onClick={refreshPage}><OpenInBrowserIcon className="navbaricons" /></NavLink></Button>
        </div>
    )
}

export default SignedOutLinks;
